26127,'Expulsion of the products of conception before the completion of gestation without deliberate interference.','en',1,'2007-10-18 04:28:24',1,'2016-07-10 02:55:15','7773FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(7801,126208,'Congenital defects of closure of one or more vertebral arches, which may be associated with malformations of the spinal cord, nerve roots, congenital fibrous bands, lipomas, and congenital cysts. These malformations range from mild (e.g., SPINA BIFIDA OCCULTA) to severe, including rachischisis where there is complete failure of neural tube and spinal cord fusion, resulting in exposure of the spinal cord at the surface. Spinal dysraphism includes all forms of spina bifida. The open form is called SPINA BIFIDA CYSTICA and the closed form is SPINA BIFIDA OCCULTA. (From Joynt, Clinical Neurology, 1992, Ch55, p34)','en',1,'2007-10-18 04:28:24',1,'2021-04-23 16:24:57','7801FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(7914,126558,'An infectious disease caused by bacteria of the genus SHIGELLA. This condition is characterized by intestinal pain and diarrhea.','en',1,'2007-10-18 04:28:24',1,'2021-04-20 21:38:33','7914FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(8328,127579,'The inability to eliminate all urine from the bladder leading to residual urine remaining in the bladder.','en',1,'2007-10-18 04:28:24',1,'2021-05-19 14:05:10','8328FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(8452,127990,'Fever in which the etiology cannot be ascertained.','en',1,'2007-11-02 20:16:08',1,'2020-05-02 17:49:26','8452FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(8508,128126,'Bronchial hemorrhage manifested with spitting of blood.','en',1,'2007-10-18 04:28:24',1,'2021-04-23 16:25:38','8508FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(9072,129566,'A developmental anomaly characterized by the presence of more than five fingers on the hand or more than five toes on the foot in primates. In non-primate vertebrates, it refers to the presence of more than the normal number of toes on the forelimb or hindlimb. (Dorland, 27th ed; Stedman, 25th ed)','en',1,'2007-10-18 04:28:24',1,'2021-04-23 16:25:15','9072FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(9467,131113,'Inflammation of the middle ear.','en',1,'2007-11-02 20:16:26',1,'2021-04-22 20:57:17','9467FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(9468,131113,'Otite moyenne','fr',1,'2007-09-06 08:51:25',1,'2021-04-22 20:57:17','9468FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(9762,132636,'A syndrome produced by severe protein deficiency, characterized by retarded growth, changes in skin and hair pigment, edema, and pathologic changes in the liver, including fatty infiltration, necrosis, and fibrosis. The word is a local name in Gold Coast, Africa, meaning displaced child. Although first reported from Africa, kwashiorkor is now known throughout the world, but mainly in the tropics and subtropics. It is considered to be related to marasmus. (From Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,'2021-04-22 20:49:04','9762FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(9763,132636,'MARASME','fr',1,'2007-07-13 13:53:41',1,'2021-04-22 20:49:04','9763FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(10003,133414,'Acute conjunctival inflammation in the newborn, usually caused by maternal gonococcal infection. The baby\'s eyes are contaminated during passage through the birth canal.','en',1,'2007-10-18 04:28:24',1,'2021-04-23 16:22:11','10003FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(10318,134213,'Abnormal smallness of the head, usually associated with mental retardation. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,'2021-04-23 16:24:37','10318FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(10354,134337,'Psychiatric illness or diseases manifested by breakdowns in the adaptational process expressed primarily as abnormalities of thought, feeling, and behavior producing either distress or impairment of function.','en',1,'2007-10-18 04:28:24',1,'2021-04-22 20:53:59','10354FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(10416,134561,'A highly contagious infectious disease caused by MORBILLIVIRUS, common among children but also seen