 to keep it as \"false\", from the Security perspective, to avoid leaking implementation details.','c9aa6e4e-4749-4978-a67a-cca9dd9fd39d',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),('webservices.rest.mandatory','false','true/false whether or not the webservices.rest module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','021369a8-6fd8-447d-a6d8-34441519928f',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),('webservices.rest.maxResultsAbsolute','100','The absolute max results limit. If the client requests a larger number of results, then will get an error','9b563c22-7805-4ee9-830c-0991cec2d94d',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),('webservices.rest.maxResultsDefault','50','The default max results limit if the user does not provide a maximum when making the web service call.','e050fe5e-cfb0-4307-ae79-e03860be24d6',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),('webservices.rest.quietDocs','true','If the value of this setting is \"true\", then nothing is logged while the Swagger specification is being generated.','73bf8a12-92f8-43a1-aab0-192fabdd6834',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),('webservices.rest.started','true','DO NOT MODIFY. true/false whether or not the webservices.rest module has been started.  This is used to make sure modules that were running  prior to a restart are started again','a1475e00-cc81-4ed9-a83d-293cf370a2e6',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),('webservices.rest.uriPrefix',NULL,'The URI prefix through which clients consuming web services will connect to the web application, should be of the form http://{ipAddress}:{port}/{contextPath}','4ed83f4f-49b9-4c7f-915d-878d485f6237',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
